92895bea-fbf2-4c54-ad90-f6738d7e54ee=Templator currently only works for apps that are publicly accessible i.e. have a public IP address. This is not the case when running locally. If you wish to test how a PDF will look like without having to deploy to the cloud there are two possibilities\:\r\n\r\nOne option is to open the page that you are trying to print in the latest Chrome browser, then press `Ctrl + P` (or `\u2318+P` if you are on Mac) and choose `Destination\: Save as PDF`. Since templator uses the same PDF engine as Chrome, the two PDFs should be identical provided that all the options are the same.\r\n\r\nAlternatively, you can use a tool such as `ngrok` or `localtunnel` to expose your local `8080` port where Mendix applications run by default. If you decide to use this method you will need to set the constant `ApplicationURLOverrideOPTIONAL` to your ngrok URL so that templator knows where to find your app.\r\n\r\nLearn more at\:
